import CardList from "../CardList";


const ActiveContestCard = () => {

    const displayContests = [];


    return (
        displayContests.length > 0 ? (
            <CardList title="Active Contests" data={displayContests} action={true} />
        ) : (
            null
        )
    );
};

export default ActiveContestCard;
